import React, { Component } from 'react';
import '../styles/NavHome.scss';

export default class NavHome extends Component {
  render() {
    return (
      <div className='back'>
        <a className='back__buttons'>About</a>
        <a className='back__buttons'>Portfolio</a>
        <a className='back__buttons'>Contact</a>
      </div>
    )
  }
}
